func:
if(Object.hasOwn(msg.payload.sensor_data,'data')){
    node.warn('In if');
    node.warn(msg.payload.sensor_data.data);
    let reworked_data = {
        x: [],
        y: [],
        z: []
    };
    for(let reading in msg.payload.sensor_data.data){
        reworked_data.x.push(msg.payload.sensor_data.data[reading].x);
        reworked_data.y.push(msg.payload.sensor_data.data[reading].y);
        reworked_data.z.push(msg.payload.sensor_data.data[reading].z);
    };
    msg.payload.sensor_data.data = reworked_data;
}
return msg;

msg.payload.reported_config.last_fly = msg.payload.lastHeard;
msg.payload.reported_config.type = msg.payload.type;
msg.payload.reported_config.nodeId = msg.payload.nodeId;
let sensors = global.get('sensor_configs');
if(typeof sensors === 'undefined'){
    sensors = {};
}
sensors[msg.payload.mac] = msg.payload.reported_config;
node.warn(sensors);
global.set('sensor_configs', sensors);
msg.payload = sensors;
return msg;

msg.payload = JSON.parse(msg.payload);
var newDevices = msg.payload.sensorSerialNumbers;
var existingDevices = flow.get('devices');

if(typeof existingDevices == 'undefined'){
    flow.set('devices',newDevices);
    msg.payload.devices = newDevices;
    return msg;
}else{
    for(let newDevice of newDevices){
        var exists = false;
        for(let existingDevice of existingDevices){
            if(newDevice == existingDevice){
                exists = true;
                break;
            }
        }
        if(!exists){
            existingDevices.push(newDevice);
        } 
    }
}
flow.set('devices',existingDevices);
msg.payload.sensorSerialNumbers = existingDevices;
return msg;

if(msg.payload.sensor_data.mode == 2){
    var devices = flow.get('devices');
    var deviceID = msg.payload.addr;
    if(typeof devices == 'undefined')return;

    for(var i = 0; i < devices.length; i++){
        // console.log('device: '+devices[i]+' deviceID: '+deviceID);
        if(deviceID == devices[i]){
            msg.payload = {};
            msg.payload.address = deviceID;
            // msg.payload.address = "00:00:00:00:00:00:ff:ff"
            msg.payload.data = [0xf4, 0x4f, 0x00, 0x00, 0x00, 0x13];
            devices.splice(i,1);
            return msg;
        }
    }
}else if(msg.payload.sensor_data.mode == 1){
    var devices = flow.get('devices');
    var deviceID = msg.payload.addr;
    if(typeof devices == 'undefined')return;
    for(var i = 0; i < devices.length; i++){
        if(deviceID == devices[i]){
            delete devices[i];
            flow.set('devices');
        }
    }
    msg.payload = devices;
    return msg;
}
